import React from "react";
import Theme from "./Theme";

import { Text, Center, TextInput, H1 } from "./styles";

export default function App() {
  return (
    <React.Fragment>
      <Theme>
        <Center>
          <H1>Login</H1>
          <Text>
            <TextInput editable maxLength={40} />
          </Text>
        </Center>
      </Theme>
    </React.Fragment>
  );
}
